import ScrollAnim from 'rc-scroll-anim';

const EventListener = ScrollAnim.Event;

ScrollAnim
.scrollScreen
.init({loop: false, duration: 500, ease: "easeInOutCirc", scrollInterval: 3000});

ReactDOM.render(< App />, document.getElementById('root'));
ReactDOM.render(<Dials/>, document.getElementById('_dialog'));
